import React, { useState, useEffect } from 'react';

const Register = () => {
  const [formData, updateFromData] = useState({
    name: '',
    email: '',
    password: '',
    confirmPassword: '',
  });
  const { name, email, password, confirmPassword } = formData;
  return <div>Register</div>;
};

export default Register;
